import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import "../styles/Hero.css";

const Hero = ({ portfolioData }) => {
  const [currentSlide, setCurrentSlide] = useState(0);

  // Sliding images related to skills and services
  const slides = [
    {
      id: 1,
      title: "Cloud Architecture & DevOps",
      subtitle: "AWS, GCP, Kubernetes, Terraform",
      description: "Design and implement scalable cloud-native solutions with infrastructure as code.",
      image: "https://images.unsplash.com/photo-1550751827-4bd374c3f58b?auto=format&fit=crop&w=1200&q=80"
    },
    {
      id: 2,
      title: "Full-Stack Development",
      subtitle: "React, Node.js, Python, Elixir",
      description: "End-to-end development of secure, scalable applications using modern technologies.",
      image: "https://images.unsplash.com/photo-1555066931-4365d14bab8c?auto=format&fit=crop&w=1200&q=80"
    },
    {
      id: 3,
      title: "Microservices & API Development",
      subtitle: "Distributed Systems, RESTful APIs, GraphQL",
      description: "Architect and develop distributed systems with secure APIs and robust communication.",
      image: "https://images.unsplash.com/photo-1550751827-4bd374c3f58b?auto=format&fit=crop&w=1200&q=80"
    },
    {
      id: 4,
      title: "Fintech & Security Solutions",
      subtitle: "Banking-grade Security, Compliance, Performance",
      description: "Specialized in financial technology platforms with high-security standards.",
      image: "https://images.unsplash.com/photo-1563014959-7aaa83350985?auto=format&fit=crop&w=1200&q=80"
    },
    {
      id: 5,
      title: "Performance Optimization",
      subtitle: "Database Optimization, Caching, Monitoring",
      description: "Optimize existing systems for better performance, scalability, and reliability.",
      image: "https://images.unsplash.com/photo-1553877522-43269d4ea984?auto=format&fit=crop&w=1200&q=80"
    }
  ];

  // Auto-rotate slides every 8 seconds (slower)
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentSlide((prevSlide) => (prevSlide + 1) % slides.length);
    }, 8000); // Increased from 5000ms to 8000ms

    return () => clearInterval(interval);
  }, []);

  const nextSlide = () => {
    setCurrentSlide((prevSlide) => (prevSlide + 1) % slides.length);
  };

  const prevSlide = () => {
    setCurrentSlide((prevSlide) => (prevSlide - 1 + slides.length) % slides.length);
  };

  const goToSlide = (index) => {
    setCurrentSlide(index);
  };

  if (!portfolioData) {
    return null;
  }

  return (
    <section className="hero">
      <div className="hero-slider">
        <div className="slider-wrapper">
          <div
            className="slider-container"
            style={{ transform: `translateX(-${currentSlide * 100}%)`, display: 'flex' }}
          >
            {slides.map((slide) => (
              <div key={slide.id} className="slide">
                <div className="slide-image" style={{ backgroundImage: `url(${slide.image})` }}></div>
                <div className="slide-overlay"></div>
                <div className="slide-content">
                  <div className="slide-text">
                    <h1 className="animate-fade-in">{slide.title}</h1>
                    <h2 className="animate-fade-in delay-100">{slide.subtitle}</h2>
                    <p className="animate-fade-in delay-200">{slide.description}</p>
                    <div className="hero-buttons animate-fade-in delay-300">
                      <Link to="/services" className="btn btn-primary glow-effect">
                        <i className="fas fa-cogs mr-2"></i>View Services
                      </Link>
                      <Link to="/projects" className="btn btn-secondary glow-effect">
                        <i className="fas fa-project-diagram mr-2"></i>View Projects
                      </Link>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>

        {/* Slider controls */}
        <div className="slider-controls">
          <button className="slider-btn prev-btn" onClick={prevSlide}>
            <i className="fas fa-chevron-left"></i>
          </button>
          <button className="slider-btn next-btn" onClick={nextSlide}>
            <i className="fas fa-chevron-right"></i>
          </button>
        </div>

        {/* Slide indicators */}
        <div className="slider-indicators">
          {slides.map((_, index) => (
            <button
              key={index}
              className={`indicator ${index === currentSlide ? 'active' : ''}`}
              onClick={() => goToSlide(index)}
            ></button>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Hero;
